import React, { Component } from 'react';
import logo from './logo.svg';
import Form from "react-jsonschema-form";
import {} from "react-bootstrap";
import {Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,CardImgOverlay,Navbar,Button,DropdownButton,Grid,UncontrolledAlert,TabContent,Row, Col} from 'reactstrap'
//import './App.css';
import Empl from  './components/employee_details'
class App extends Component {
  render() {
    return (
        <div>
          <Card inverse>
            <CardImg width="100%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97270&w=318&h=270&bg=333333&txtclr=666666" alt="Card image cap" />
            <CardImgOverlay>
              <CardTitle>Card Title</CardTitle>
              <CardText>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</CardText>
              <CardText>
                <small className="text-muted">Last updated 3 mins ago</small>
              </CardText>
            </CardImgOverlay>
          </Card>
        </div>
    );
  }
}

export default App;
